import React from "react";
import "./Table.css";

function Table(props) {
    return (
        <table className="table table-striped table-bright table-hover">
        <thead>
        <tr>
            <th scope="col">Picture</th>
            <th value="name.first" scope="col" className="sort-option" onClick={props.colOrder}>Name</th>
            <th value="last" scope="col" onClick={props.colOrder}>Last Name</th>
            <th scope="col" onClick={props.colOrder}>Email</th>
            <th value="dob" scope="col" onClick={props.colOrder}>ID</th>
            </tr>
        </thead>
        <tbody>
            {props.children}
        </tbody>
        </table>
    );
}

export default Table;
